import { Link } from "react-router-dom";
import previewer from "../../Assets/Images/Upload-video-preview.jpg";
import "./UploadVideo.scss";

class UploadVideo extends React.Component {
  render() {
    return (
      <div className="uploadVideo">

          <h2>Upload Video</h2>
          <h4>Video Thumbnail</h4>
        <div className="uploadVideo__thumbnail">
          <img className="uploadVideo__thumbnail--img" src={previewer} />
        </div>

        <form>
            <lable>title your video
                <input type="text" name="videoTitle" />
            </lable>

            <lable>add a video description
                <input type="text" name="videoDes" />
            </lable>

            <button type="submit">PUBLISH</button>
        </form>
      </div>
    );
  }
}

export default UploadVideo;
